import React from "react";

export class Counter extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      count: 0
    };
  }

  render() {
    return (
      <div>
        <div>count: {this.state.count}</div>
        <button>increment!</button>
      </div>
    );
  }
}
